INSERT INTO `product_translation` VALUES ('2021-07-30 11:24:06.613829','2021-07-30 11:24:06.000000','en','Laptop','laptop','Now equipped with seventh-generation Intel Core processors, Laptop is snappier than ever. From daily tasks like launching apps and opening files to more advanced computing, you can power through your day thanks to faster SSDs and Turbo Boost processing up to 3.6GHz.',1,1),('2021-07-30 11:24:06.835584','2021-07-30 11:24:06.000000','en','Tablet','tablet','If the computer were invented today, what would it look like? It would be powerful enough for any task. So mobile you could take it everywhere. And so intuitive you could use it any way you wanted  with touch, a keyboard, or even a pencil. In other words, it wouldnt really be a \"computer.\" It would be Tablet.',2,2),('2021-07-30 11:24:06.939497','2021-07-30 11:24:06.000000','en','Wireless Optical Mouse','cordless-mouse','The Logitech M185 Wireless Optical Mouse is a great device for any computer user, and as Logitech are the global market leaders for these devices, you are also guaranteed absolute reliability. A mouse to be reckoned with!',3,3),('2021-07-30 11:24:07.001076','2021-07-30 11:24:07.000000','en','32-Inch Monitor','32-inch-monitor','The UJ59 with Ultra HD resolution has 4x the pixels of Full HD, delivering more screen space and amazingly life-like images. That means you can view documents and webpages with less scrolling, work more comfortably with multiple windows and toolbars, and enjoy photos, videos and games in stunning 4K quality. Note: beverage not included.',4,4),('2021-07-30 11:24:07.051066','2021-07-30 11:24:07.000000','en','Curvy Monitor','curvy-monitor','Discover a truly immersive viewing experience with this monitor curved more deeply than any other. Wrapping around your field of vision the 1,800 R screencreates a wider field of view, enhances depth perception, and minimises peripheral distractions to draw you deeper in to your content.',5,5),('2021-07-30 11:24:07.134307','2021-07-30 11:24:07.000000','en','High Performance RAM','high-performance-ram','Each RAM module is built with a pure aluminium heat spreader for faster heat dissipation and cooler operation. Enhanced to XMP 2.0 profiles for better overclocking; Compatibility: Intel 100 Series, Intel 200 Series, Intel 300 Series, Intel X299, AMD 300 Series, AMD 400 Series.',6,6),('2021-07-30 11:24:07.286754','2021-07-30 11:24:07.000000','en','Gaming PC','gaming-pc','This pc is optimised for gaming, and is also VR ready. The Intel Core-i7 CPU and High Performance GPU give the computer the raw power it needs to function at a high level.',7,7),('2021-07-30 11:24:07.442632','2021-07-30 11:24:07.000000','en','Hard Drive','hard-drive','Boost your PC storage with this internal hard drive, designed just for desktop and all-in-one PCs.',8,8),('2021-07-30 11:24:07.629159','2021-07-30 11:24:07.000000','en','Clacky Keyboard','clacky-keyboard','Let all your colleagues know that you are typing on this exclusive, colorful klicky-klacky keyboard. Huge travel on each keypress ensures maximum klack on each and every keystroke.',9,9),('2021-07-30 11:24:07.660061','2021-07-30 11:24:07.000000','en','Ethernet Cable','ethernet-cable','5m (metres) Cat.6 network cable (upwards/downwards compatible) | Patch cable | 2 RJ-45 plug | plug with bend protection mantle. High transmission speeds due to operating frequency with up to 250 MHz (in comparison to Cat.5/Cat.5e cable bandwidth of 100 MHz).',10,10),('2021-07-30 11:24:07.700695','2021-07-30 11:24:07.000000','en','USB Cable','usb-cable','Solid conductors eliminate strand-interaction distortion and reduce jitter. As the surface is made of high-purity silver, the performance is very close to that of a solid silver cable, but priced much closer to solid copper cable.',11,11),('2021-07-30 11:24:07.777758','2021-07-30 11:24:07.000000','en','Instant Camera','instant-camera','With its nostalgic design and simple point-and-shoot functionality, the Instant Camera is the perfect pick to get started with instant photography.',12,12),('2021-07-30 11:24:07.840078','2021-07-30 11:24:07.000000','en','Camera Lens','camera-lens','This lens is a Di type lens using an optical system with improved multi-coating designed to function with digital SLR cameras as well as film cameras.',13,13),('2021-07-30 11:24:07.881724','2021-07-30 11:24:07.000000','en','Vintage Folding Camera','vintage-folding-camera','This vintage folding camera is so antiquated that you cannot possibly hope to produce actual photographs with it. However, it makes a wonderful decorative piece for the home or office.',14,14),('2021-07-30 11:24:07.920095','2021-07-30 11:24:07.000000','en','Tripod','tripod','Capture vivid, professional-style photographs with help from this lightweight tripod. The adjustable-height tripod makes it easy to achieve reliable stability and score just the right angle when going after that award-winning shot.',15,15),('2021-07-30 11:24:07.970033','2021-07-30 11:24:07.000000','en','Instamatic Camera','instamatic-camera','This inexpensive point-and-shoot camera uses easy-to-load 126 film cartridges. A built-in flash unit ensure great results, no matter the lighting conditions.',16,16),('2021-07-30 11:24:08.035794','2021-07-30 11:24:08.000000','en','Compact Digital Camera','compact-digital-camera','Unleash your creative potential with high-level performance and advanced features such as AI-powered Real-time Eye AF; new, high-precision Real-time Tracking; high-speed continuous shooting and 4K HDR movie-shooting. The camera\'s innovative AF quickly and reliably detects the position of the subject and then tracks the subject\'s motion, keeping it in sharp focus.',17,17),('2021-07-30 11:24:08.085311','2021-07-30 11:24:08.000000','en','Nikkormat SLR Camera','nikkormat-slr-camera','The Nikkormat FS was brought to market by Nikon in 1965. The lens is a 50mm f1.4 Nikkor. Nice glass, smooth focus and a working diaphragm. A UV filter and a Nikon front lens cap