een designed with your comfort in mind. This well-padded chair has foam pocket sprung seat cushions and fibre-filled back cushions.',155,155),('2021-08-03 22:17:06.714227','2021-08-03 22:17:06.000000','en','Light Shade','light-shade','Modern tapered white polycotton pendant shade with a metallic silver chrome interior finish for maximum light reflection. Reversible gimble so it can be used as a ceiling shade or as a lamp shade.',156,156),('2021-08-03 22:17:06.746759','2021-08-03 22:17:06.000000','en','Wooden Side Desk','wooden-side-desk','Drawer stops prevent the drawers from being pulled out too far. Built-in cable management for collecting cables and cords; out of sight but close at hand.',157,157),('2021-08-03 22:17:06.791761','2021-08-03 22:17:06.000000','en','Comfy Padded Chair','comfy-padded-chair','You sit comfortably thanks to the shaped back. The chair frame is made of solid wood, which is a durable natural material.',158,158),('2021-08-03 22:17:06.838673','2021-08-03 22:17:06.000000','en','Black Eaves Chair','black-eaves-chair','Comfortable to sit on thanks to the bowl-shaped seat and rounded shape of the backrest. No tools are required to assemble the chair, you just click it together with a simple mechanism under the seat.',159,159),('2021-08-03 22:17:06.887680','2021-08-03 22:17:06.000000','en','Wooden Stool','wooden-stool','Solid wood is a hardwearing natural material, which can be sanded and surface treated as required.',160,160),('2021-08-03 22:17:06.917892','2021-08-03 22:17:06.000000','en','Bedside Table','bedside-table','Every table is unique, with varying grain pattern and natural colour shifts that are part of the charm of wood.',161,161),('2021-08-03 22:17:06.949110','2021-08-03 22:17:06.000000','en','Modern Cafe Chair','modern-cafe-chair','You sit comfortably thanks to the restful flexibility of the seat. Lightweight and easy to move around, yet stable enough even for the liveliest, young family members.',162,162);
