tyle photographs with help from this lightweight tripod. The adjustable-height tripod makes it easy to achieve reliable stability and score just the right angle when going after that award-winning shot.','tripod','B00XI87KV8',1498,1498,'1,2','1,9,13','2,4,11,13,20,22','electronics,camera-photo,electronics-2,camera-photo-2,electronics-3,camera-photo-3','1','preview/21/zoltan-tasi-423051-unsplash__preview.jpg',NULL,'',NULL,29,1,15,15,NULL),('en',1,'Instamatic Camera','Instamatic Camera','This inexpensive point-and-shoot camera uses easy-to-load 126 film cartridges. A built-in flash unit ensure great results, no matter the lighting conditions.','instamatic-camera','B07K1330LL',2000,2000,'1,2','1,9,14','2,4,11,13,20,22','electronics,camera-photo,electronics-2,camera-photo-2,electronics-3,camera-photo-3','1','preview/5b/jakob-owens-274337-unsplash__preview.jpg',NULL,'',NULL,30,1,16,16,NULL),('en',1,'Compact Digital Camera','Compact Digital Camera','Unleash your creative potential with high-level performance and advanced features such as AI-powered Real-time Eye AF; new, high-precision Real-time Tracking; high-speed continuous shooting and 4K HDR movie-shooting. The camera\'s innovative AF quickly and reliably detects the position of the subject and then tracks the subject\'s motion, keeping it in sharp focus.','compact-digital-camera','B07D990021',89999,89999,'1,2','1,9,15','2,4,11,13,20,22','electronics,camera-photo,electronics-2,camera-photo-2,electronics-3,camera-photo-3','1','preview/bc/patrick-brinksma-663044-unsplash__preview.jpg',NULL,'',NULL,31,1,17,17,NULL),('en',1,'Nikkormat SLR Camera','Nikkormat SLR Camera','The Nikkormat FS was brought to market by Nikon in 1965. The lens is a 50mm f1.4 Nikkor. Nice glass, smooth focus and a working diaphragm. A UV filter and a Nikon front lens cap are included with the lens.','nikkormat-slr-camera','B07D33B334',61500,61500,'1,2','1,9,11','2,4,11,13,20,22','electronics,camera-photo,electronics-2,camera-photo-2,electronics-3,camera-photo-3','1','preview/95/chuttersnap-324234-unsplash__preview.jpg',NULL,'',NULL,32,1,18,18,NULL),('en',1,'Compact SLR Camera','Compact SLR Camera','Retro styled, portable in size and built around a powerful 24-megapixel APS-C CMOS sensor, this digital camera is the ideal companion for creative everyday photography. Packed full of high spec features such as an advanced hybrid autofocus system able to keep pace with even the most active subjects, a speedy 6fps continuous-shooting mode, high-resolution electronic viewfinder and intuitive swivelling touchscreen, it brings professional image making into everyones grasp.','compact-slr-camera','B07D75V44S',52100,52100,'1','1,9','2,4,11,13,20,22','electronics,camera-photo,electronics-2,camera-photo-2,electronics-3,camera-photo-3','1','preview/9d/robert-shunev-528016-unsplash__preview.jpg',NULL,'',NULL,33,1,19,19,NULL),('en',1,'Twin Lens Camera','Twin Lens Camera','What makes a Rolleiflex TLR so special? Many things. To start, TLR stands for twin lens reflex. Twin because there are two lenses. And reflex means that the photographer looks through the lens to view the reflected image of an object or scene on the focusing screen.','twin-lens-camera','B07D78JTLR',79900,79900,'1,2','1,9,16','2,4,11,13,20,22','electronics,camera-photo,electronics-2,camera-photo-2,electronics-3,camera-photo-3','1','preview/ef/alexander-andrews-260988-unsplash__preview.jpg',NULL,'',NULL,34,1,20,20,NULL),('en',1,'Road Bike','Road Bike','Featuring a full carbon chassis - complete with cyclocross-specific carbon fork - and a component setup geared for hard use on the race circuit, it\'s got the low weight, exceptional efficiency and brilliant handling you\'ll need to stay at the front of the pack.','road-bike','RB000844334',249900,249900,'1,2','17,18,19','8,9,17,18,26,27','sports-outdoor,equipment,sports-outdoor-2,equipment-2,sports-outdoor-3,equipment-3','1','preview/2f/mikkel-bech-748940-unsplash__preview.jpg',NULL,'',NULL,35,1,21,21,NULL),('e