','23,25','home-garden-3,plants-3','1','preview/29/silvia-agrasar-227575-unsplash__preview.jpg',NULL,'',NULL,246,1,146,146,NULL),('en',1,'Fern Blechnum Gibbum','Fern Blechnum Gibbum','Create a tropical feel in your home with this lush green tree fern, it has decorative leaves and will develop a short slender trunk in time.','fern-blechnum-gibbum','A04851',895,895,'1,6','30,31,43','23,25','home-garden-3,plants-3','1','preview/6d/caleb-george-536388-unsplash__preview.jpg',NULL,'',NULL,247,1,147,147,NULL),('en',1,'Assorted Indoor Succulents','Assorted Indoor Succulents','These assorted succulents come in a variety of different shapes and colours - each with their own unique personality. Succulents grow best in plenty of light: a sunny windowsill would be the ideal spot for them to thrive!','assorted-succulents','A08593',3250,3250,'1,6','30,31,42','23,25','home-garden-3,plants-3','1','preview/81/annie-spratt-78044-unsplash__preview.jpg',NULL,'',NULL,248,1,148,148,NULL),('en',1,'Orchid','Orchid','Gloriously elegant. It can go along with any interior as it is a neutral color and the most popular Phalaenopsis overall. 2 to 3 foot stems host large white flowers that can last for over 2 months.','orchid','ROR00221',6500,6500,'1','30,31','23,25','home-garden-3,plants-3','1','preview/88/zoltan-kovacs-642412-unsplash__preview.jpg',NULL,'',NULL,249,1,149,149,NULL),('en',1,'Bonsai Tree','Bonsai Tree','Excellent semi-evergreen bonsai. Indoors or out but needs some winter protection. All trees sent will leave the nursery in excellent condition and will be of equal quality or better than the photograph shown.','bonsai-tree','B01MXFLUSV',1999,1999,'1','30,31','23,25','home-garden-3,plants-3','1','preview/f3/mark-tegethoff-667351-unsplash__preview.jpg',NULL,'',NULL,250,1,150,150,NULL),('en',1,'Guardian Lion Statue','Guardian Lion Statue','Placing it at home or office can bring you fortune and prosperity, guard your house and ward off ill fortune.','guardian-lion-statue','GL34LLW11',18