ht Shade','Modern tapered white polycotton pendant shade with a metallic silver chrome interior finish for maximum light reflection. Reversible gimble so it can be used as a ceiling shade or as a lamp shade.','light-shade','B45809LSW',2845,2845,'1','30,34','23,24','home-garden-3,furniture-3','1','preview/5f/pierre-chatel-innocenti-483198-unsplash__preview.jpg',NULL,'',NULL,256,1,156,156,NULL),('en',1,'Wooden Side Desk','Wooden Side Desk','Drawer stops prevent the drawers from being pulled out too far. Built-in cable management for collecting cables and cords; out of sight but close at hand.','wooden-side-desk','304.096.29',12500,12500,'1,3','30,34,37','23,24','home-garden-3,furniture-3','1','preview/40/abel-y-costa-716024-unsplash__preview.jpg',NULL,'',NULL,257,1,157,157,NULL),('en',1,'Comfy Padded Chair','Comfy Padded Chair','You sit comfortably thanks to the shaped back. The chair frame is made of solid wood, which is a durable natural material.','comfy-padded-chair','404.068.14',13000,13000,'1,3','30,34,35','23,24','home-garden-3,furniture-3','1','preview/3b/kari-shea-398668-unsplash__preview.jpg',NULL,'',NULL,258,1,158,158,NULL),('en',1,'Black Eaves Chair','Black Eaves Chair','Comfortable to sit on thanks to the bowl-shaped seat and rounded shape of the backrest. No tools are required to assemble the chair, you just click it together with a simple mechanism under the seat.','black-eaves-chair','003.600.02',7000,7000,'1,3','30,34,27','23,24','home-garden-3,furniture-3','1','preview/09/andres-jasso-220776-unsplash__preview.jpg',NULL,'',NULL,259,1,159,159,NULL),('en',1,'Wooden Stool','Wooden Stool','Solid wood is a hardwearing natural material, which can be sanded and surface treated as required.','wooden-stool','202.493.30',1400,1400,'1,3','30,34,37','23,24','home-garden-3,furniture-3','1','preview/d0/ruslan-bardash-351288-unsplash__preview.jpg',NULL,'',NULL,260,1,160,160,NULL),('en',1,'Bedside Table','Bedside Table','Every table is unique, with varying grain pattern and natural colour shifts that are part of the charm of wood.','bedside-table','404.290.14',13000,13000,'1,3','30,34,28','23,24','home-garden-3,furniture-3','1','preview/72/benjamin-voros-310026-unsplash__preview.jpg',NULL,'',NULL,261,1,161,161,NULL),('en',1,'Modern Cafe Chair','Modern Cafe Chair mustard','You sit comfortably thanks to the restful flexibility of the seat. Lightweight and easy to move around, yet stable enough even for the liveliest, young family members.','modern-cafe-chair','404.038.96',10000,10000,'3,1','38,30,34','23,24','home-garden-3,furniture-3','1','preview/b1/jean-philippe-delberghe-1400011-unsplash__preview.jpg',NULL,'',NULL,262,1,162,162,NULL),('en',1,'Modern Cafe Chair','Modern Cafe Chair mint','You sit comfortably thanks to the restful flexibility of the seat. Lightweight and easy to move around, yet stable enough even for the liveliest, young family members.','modern-cafe-chair','404.038.96',10000,10000,'3,1','39,30,34','23,24','home-garden-3,furniture-3','1','preview/b1/jean-philippe-delberghe-1400011-unsplash__preview.jpg',NULL,'',NULL,263,1,162,162,NULL),('en',1,'Modern Cafe Chair','Modern Cafe Chair pearl','You sit comfortably thanks to the restful flexibility of the seat. Lightweight and easy to move around, yet stable enough even for the liveliest, young family members.','modern-cafe-chair','404.038.96',10000,10000,'3,1','28,30,34','23,24','home-garden-3,furniture-3','1','preview/b1/jean-philippe-delberghe-1400011-unsplash__preview.jpg',NULL,'',NULL,264,1,162,162,NULL);
